import React from 'react';
import './AnimeCatalog.css'; // Certifique-se de que esse arquivo CSS existe

const AnimeCatalog = () => {
    return (
        <div className="anime-catalog">
            <h1>Catálogo de Animes</h1>
            <p>Aqui você encontrará uma lista dos animes disponíveis.</p>
            {/* Adicione mais conteúdo do catálogo de animes aqui */}
        </div>
    );
};

export default AnimeCatalog;
